import React from 'react';

import NavBar from './NavBar';

const useStyles = makeStyles({
  root: {
    flexGrow: 1,
  },
  navBar: {
    paddingTop: "10px", 
    backgroundColor: "#31353d",
    color: "#FFF",
    display: "flex",
    justifyContent: "center",
  },
  navOpt: {
    borderRadius: "1.4em 1.4em 0 0",
  },
  navOptSelected: {
    backgroundColor: "#5bb136",
  },
  navOptIndicator: {
    backgroundColor: "#5bb136",
  },
});

function App() {
  return (
    <NavBar />
  );
}

export default App;
